import classes from './CompareTeam.module.css'

const CompareTeam = () => {
    return (
        <div className={classes.body}>
        <div className={classes.sign}>
          <span className={classes.fastflicker}>V</span><span className={classes.jump}>/</span><span className={classes.flicker}>S</span>
        </div>
      </div>
    )
}

export default CompareTeam;
